CREATE FUNCTION public.my_f(d1 date, d2 date, window_size integer) RETURNS TABLE(client integer, goods integer, ddate date, ssum integer, predication double precision)
    LANGUAGE plpgsql
    AS $$
DECLARE
    curs CURSOR FOR SELECT recept.client cl, recgoods.goods g, recept.ddate d, sum(recgoods.volume * recgoods.price) s
                    FROM recept
                             JOIN recgoods ON (recept.id = recgoods.subid)
                    WHERE recept.ddate >= d1
                      AND recept.ddate <= d2
                    GROUP BY recept.client, recgoods.goods, recept.ddate

    ;
    pred    double precision;
    cnt     int;
--     cursor
    cl      int;
    dg      int;
    dd      date;
    ss      int;
    prev_cl int;
    prev_g  int;

BEGIN
    CREATE TEMP TABLE t
    (
        client      int,
        goods       int,
        ddate       date,
        ssum        int,
        predicition double precision
    );
    prev_cl = -1;
    prev_g = -1;

    OPEN curs;
    cnt = 0;
    LOOP

        FETCH curs INTO cl, dg, dd, ss;
        EXIT WHEN NOT FOUND;
        IF cnt < window_size THEN
            pred = ss;
        ELSE


            IF cl != prev_cl OR prev_g != dg THEN
                pred = ss;
            ELSE
                SELECT sum(temp.ssum) / window_size
                INTO pred
                FROM (SELECT t.ssum
                      FROM t
                      WHERE t.goods = dg
                        AND t.client = cl
                      ORDER BY t.ddate
                      LIMIT window_size
                     ) temp;
            END IF;

            prev_cl = cl;
            prev_g = dg;
        END IF;

        cnt = cnt + 1;

    END LOOP;


    CLOSE curs;
    RETURN QUERY SELECT * FROM t ORDER BY t.ddate;
    DROP TABLE t;
END;
$$;


