CREATE FUNCTION public.predict(d1 date, d2 date, window_size integer) RETURNS TABLE(region integer, ddate date, ssum integer, prediction double precision)
    LANGUAGE plpgsql
    AS $$
DECLARE
    curs CURSOR FOR SELECT city.region, recept.ddate, SUM(goods.weight * recgoods.volume)
                    FROM city
                             JOIN client ON client.city = city.id
                             JOIN recept ON recept.client = client.id
                             JOIN recgoods ON recgoods.subid = recept.id
                             JOIN goods ON goods.id = recgoods.goods
                    WHERE recept.ddate BETWEEN '2020-01-01' AND '2020-12-31'
                    GROUP BY city.region, recept.ddate ;
    pred double precision;
    cnt  int;
    rg   int;
    dd   date;
    ss   int;


BEGIN
    CREATE TEMP TABLE t
    (
        region     int,
        ddate      date,
        ssum       int,
        prediction double precision
    );

    OPEN curs;
    cnt = 0;

    LOOP
        FETCH curs INTO rg, dd, ss;
        EXIT WHEN NOT FOUND;

        pred = (SELECT sum(d.ssum)
                FROM (SELECT t.ssum, row_number() OVER () AS row_n FROM t) AS d
                WHERE d.row_n > cnt - window_size
                  AND d.row_n < cnt)
                   / window_size;

        cnt = cnt + 1;
    END LOOP;

    CLOSE curs;
    RETURN QUERY SELECT * FROM t;
    DROP TABLE t;
END;
$$;


